import React from 'react';
import {Link} from 'react-router-dom';
const BotonRegistro = () => {
    return ( 
        <Link to ="/registro" className="btn btn-light ml-md-2 mt-2 mt-md-0">
            Crear Usuarios
        </Link>
     );
}
 
export default BotonRegistro;
